# ===============================================================================================
# The constraints of this problem are huge, which makes the regular Insertion Sort time out.
# We use Divide and Conquer - mergesort and determine the number of swaps needed to sort
# the list.
# 1 <= n <= 10^5
# 1 <= a[i] <= 10^7
# ===============================================================================================

#
# Complete the 'insertionSort' function below.
#
# The function is expected to return an INTEGER.
# The function accepts INTEGER_ARRAY arr as parameter.
#

def insertionSort(arr):
    # Write your code here
    def merge(arr1, arr2):
        global shifts
        N, M = len(arr1), len(arr2)
        i, j = 0, 0
        arr = list()
        while i < N and j < M:
            if arr1[i] <= arr2[j]:
                arr.append(arr1[i])
                i += 1
            elif arr2[j] < arr1[i]:
                shifts += len(arr1) - i
                arr.append(arr2[j])
                j += 1
        while i < N:
            arr.append(arr1[i])
            i += 1
        while j < M:
            arr.append(arr2[j])
            j += 1
        return arr
    def mergeSort(arr):
        if len(arr) <= 1:
            return arr
        N = len(arr)
        arr1 = mergeSort(arr[:N//2])
        arr2 = mergeSort(arr[N//2:])
        arr = merge(arr1, arr2)
        return arr
    global shifts
    shifts = 0
    arr = mergeSort(arr)
    return shifts

